import React from "react";

const route = [
  {
    path: "/website",
    sidebar: (
      <ul>
        <li key="websiteinfo">
          <Link to="/websiteinfo">Web Site Info</Link>
        </li>
        <li key="credentials">
          <Link to="/credentials">Credentials</Link>
        </li>
        <li key="status">
          <Link to="/status">Status</Link>
        </li>
      </ul>
    )
  },
  {
    path: "/projects",
    sidebarLink: ["ProjectLink", "ProjectLink", "ProjectLink"]
  }
];

export default route;
